import React from 'react'
import arr from './all/1.mp4'
import './App.css';
import ReactPlayer from 'react-player';


const App = () => {
    return (
        <div>
            <ReactPlayer url={arr} controls loop></ReactPlayer>
        </div>
    )
}

export default App
